import React from 'react';

function Home(prop) {

    return (
        <div className="container">
            <div className="row align-items.start">
                <div className="col-12 col-md m-1">
                    <RenderCard item={prop.dish} />
                </div>
                <div className="col-12 col-md m-1">
                    <RenderCard item={prop.promotion} />
                </div>
                <div className="col-12 col-md m-1">
                    <RenderCard item={prop.leader} />
                </div>
            </div>
        </div>
    );
}

export default Home;
